import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import HelpIcon from '@material-ui/icons/Help';
import ChatBubble from '@material-ui/icons/ChatBubble';
import Home from '@material-ui/icons/Home';
import Groups from '@material-ui/icons/Group';
import Store from '@material-ui/icons/Store';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-prevent-tabpanel-${index}`}
      aria-labelledby={`scrollable-prevent-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `scrollable-prevent-tab-${index}`,
    'aria-controls': `scrollable-prevent-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
    noneShawdow: {
        boxShadow: "none",
      },
}));

export default function ScrollableTabsButtonPrevent() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
        <Tabs
          value={value}
          onChange={handleChange}
          // variant="scrollable"
          // scrollButtons="on"
          aria-label=""
          centered
        >
          <Tab icon={<Home />} aria-label="Home" {...a11yProps(0)} />
          <Tab icon={<ChatBubble />} aria-label="Message" {...a11yProps(1)} />
          <Tab icon={<Groups />} aria-label="Groups" {...a11yProps(2)} />
          <Tab icon={<Store />} aria-label="Market Place" {...a11yProps(3)} />
          <Tab icon={<Store />} aria-label="Market Place" {...a11yProps(4)} />
        </Tabs>
  );
}
